import React, { Component } from "react";



class Person extends Component {

    constructor(props){
        super(props);
        this.state = { val: '' }
    }



    render() { 
        return ( 

                <div>
                    <h4>Person #{this.props.value}</h4>
                    <form>
                        <label htmlFor="">Address</label>
                        <input type="text" onChange={(e) => this.props.onSet(e.target.value)}/>
                        <br/>
                    </form>
                </div>
            );
    }
}
 
export default Person;
